import GlobalStyles from "./components/Reset";
import styled from "styled-components";
import Router from "./Router";

const Page = styled.div`
  width: 100vw;
  height: 100vh;
  position: relative;
`;

function App() {
  return (
    <Page>
      <GlobalStyles />
      <span>App</span>
    </Page>
  );
}

export default App;
